@testset "4.1.10 (c+d x)^m (a+b sin)^n" begin
    @variables a, b, c, d, e, f, m, n, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(e+f*x)^m*(a+b*sin(c+d*x))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^m*(b*sin(e+f*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^m*sin(e+f*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sin(a + b*x)*(c + d*x)^4, x, 5, -((24*d^4*cos(a + b*x))/b^5) + (12*d^2*(c + d*x)^2*cos(a + b*x))/b^3 - ((c + d*x)^4*cos(a + b*x))/b - (24*d^3*(c + d*x)*sin(a + b*x))/b^4 + (4*d*(c + d*x)^3*sin(a + b*x))/b^2]
    @test_int [sin(a + b*x)*(c + d*x)^3, x, 4, (6*d^2*(c + d*x)*cos(a + b*x))/b^3 - ((c + d*x)^3*cos(a + b*x))/b - (6*d^3*sin(a + b*x))/b^4 + (3*d*(c + d*x)^2*sin(a + b*x))/b^2]
    @test_int [sin(a + b*x)*(c + d*x)^2, x, 3, (2*d^2*cos(a + b*x))/b^3 - ((c + d*x)^2*cos(a + b*x))/b + (2*d*(c + d*x)*sin(a + b*x))/b^2]
    @test_int [sin(a + b*x)*(c + d*x)^1, x, 2, -(((c + d*x)*cos(a + b*x))/b) + (d*sin(a + b*x))/b^2]
    @test_int [sin(a + b*x)/(c + d*x)^1, x, 3, (CosIntegral((b*c)/d + b*x)*sin(a - (b*c)/d))/d + (cos(a - (b*c)/d)*SinIntegral((b*c)/d + b*x))/d]
    @test_int [sin(a + b*x)/(c + d*x)^2, x, 4, (b*cos(a - (b*c)/d)*CosIntegral((b*c)/d + b*x))/d^2 - sin(a + b*x)/(d*(c + d*x)) - (b*sin(a - (b*c)/d)*SinIntegral((b*c)/d + b*x))/d^2]
    @test_int [sin(a + b*x)/(c + d*x)^3, x, 5, -((b*cos(a + b*x))/(2*d^2*(c + d*x))) - (b^2*CosIntegral((b*c)/d + b*x)*sin(a - (b*c)/d))/(2*d^3) - sin(a + b*x)/(2*d*(c + d*x)^2) - (b^2*cos(a - (b*c)/d)*SinIntegral((b*c)/d + b*x))/(2*d^3)]


    @test_int [sin(a + b*x)^2*(c + d*x)^4, x, 6, (3*d^4*x)/(4*b^4) - (d*(c + d*x)^3)/(2*b^2) + (c + d*x)^5/(10*d) - (3*d^4*cos(a + b*x)*sin(a + b*x))/(4*b^5) + (3*d^2*(c + d*x)^2*cos(a + b*x)*sin(a + b*x))/(2*b^3) - ((c + d*x)^4*cos(a + b*x)*sin(a + b*x))/(2*b) - (3*d^3*(c + d*x)*sin(a + b*x)^2)/(2*b^4) + (d*(c + d*x)^3*sin(a + b*x)^2)/b^2]
    @test_int [sin(a + b*x)^2*(c + d*x)^3, x, 4, -((3*c*d^2*x)/(4*b^2)) - (3*d^3*x^2)/(8*b^2) + (c + d*x)^4/(8*d) + (3*d^2*(c + d*x)*cos(a + b*x)*sin(a + b*x))/(4*b^3) - ((c + d*x)^3*cos(a + b*x)*sin(a + b*x))/(2*b) - (3*d^3*sin(a + b*x)^2)/(8*b^4) + (3*d*(c + d*x)^2*sin(a + b*x)^2)/(4*b^2)]
    @test_int [sin(a + b*x)^2*(c + d*x)^2, x, 4, -((d^2*x)/(4*b^2)) + (c + d*x)^3/(6*d) + (d^2*cos(a + b*x)*sin(a + b*x))/(4*b^3) - ((c + d*x)^2*cos(a + b*x)*sin(a + b*x))/(2*b) + (d*(c + d*x)*sin(a + b*x)^2)/(2*b^2)]
    @test_int [sin(a + b*x)^2*(c + d*x)^1, x, 2, (c*x)/2 + (d*x^2)/4 - ((c + d*x)*cos(a + b*x)*sin(a + b*x))/(2*b) + (d*sin(a + b*x)^2)/(4*b^2)]
    @test_int [sin(a + b*x)^2/(c + d*x)^1, x, 5, -((cos(2*a - (2*b*c)/d)*CosIntegral((2*b*c)/d + 2*b*x))/(2*d)) + log(c + d*x)/(2*d) + (sin(2*a - (2*b*c)/d)*SinIntegral((2*b*c)/d + 2*b*x))/(2*d)]
    @test_int [sin(a + b*x)^2/(c + d*x)^2, x, 5, (b*CosIntegral((2*b*c)/d + 2*b*x)*sin(2*a - (2*b*c)/d))/d^2 - sin(a + b*x)^2/(d*(c + d*x)) + (b*cos(2*a - (2*b*c)/d)*SinIntegral((2*b*c)/d + 2*b*x))/d^2]
    @test_int [sin(a + b*x)^2/(c + d*x)^3, x, 7, (b^2*cos(2*a - (2*b*c)/d)*CosIntegral((2*b*c)/d + 2*b*x))/d^3 - (b*cos(a + b*x)*sin(a + b*x))/(d^2*(c + d*x)) - sin(a + b*x)^2/(2*d*(c + d*x)^2) - (b^2*sin(2*a - (2*b*c)/d)*SinIntegral((2*b*c)/d + 2*b*x))/d^3]
    @test_int [sin(a + b*x)^2/(c + d*x)^4, x, 7, -(b^2/(3*d^3*(c + d*x))) - (2*b^3*CosIntegral((2*b*c)/d + 2*b*x)*sin(2*a - (2*b*c)/d))/(3*d^4) - (b*cos(a + b*x)*sin(a + b*x))/(3*d^2*(c + d*x)^2) - sin(a + b*x)^2/(3*d*(c + d*x)^3) + (2*b^2*sin(a + b*x)^2)/(3*d^3*(c + d*x)) - (2*b^3*cos(2*a - (2*b*c)/d)*SinIntegral((2*b*c)/d + 2*b*x))/(3*d^4)]


    @test_int [sin(a + b*x)^3*(c + d*x)^4, x, 12, -((488*d^4*cos(a + b*x))/(27*b^5)) + (80*d^2*(c + d*x)^2*cos(a + b*x))/(9*b^3) - (2*(c + d*x)^4*cos(a + b*x))/(3*b) + (8*d^4*cos(a + b*x)^3)/(81*b^5) - (160*d^3*(c + d*x)*sin(a + b*x))/(9*b^4) + (8*d*(c + d*x)^3*sin(a + b*x))/(3*b^2) + (4*d^2*(c + d*x)^2*cos(a + b*x)*sin(a + b*x)^2)/(9*b^3) - ((c + d*x)^4*cos(a + b*x)*sin(a + b*x)^2)/(3*b) - (8*d^3*(c + d*x)*sin(a + b*x)^3)/(27*b^4) + (4*d*(c + d*x)^3*sin(a + b*x)^3)/(9*b^2)]
    @test_int [sin(a + b*x)^3*(c + d*x)^3, x, 8, (40*d^2*(c + d*x)*cos(a + b*x))/(9*b^3) - (2*(c + d*x)^3*cos(a + b*x))/(3*b) - (40*d^3*sin(a + b*x))/(9*b^4) + (2*d*(c + d*x)^2*sin(a + b*x))/b^2 + (2*d^2*(c + d*x)*cos(a + b*x)*sin(a + b*x)^2)/(9*b^3) - ((c + d*x)^3*cos(a + b*x)*sin(a + b*x)^2)/(3*b) - (2*d^3*sin(a + b*x)^3)/(27*b^4) + (d*(c + d*x)^2*sin(a + b*x)^3)/(3*b^2)]
    @test_int [sin(a + b*x)^3*(c + d*x)^2, x, 6, (14*d^2*cos(a + b*x))/(9*b^3) - (2*(c + d*x)^2*cos(a + b*x))/(3*b) - (2*d^2*cos(a + b*x)^3)/(27*b^3) + (4*d*(c + d*x)*sin(a + b*x))/(3*b^2) - ((c + d*x)^2*cos(a + b*x)*sin(a + b*x)^2)/(3*b) + (2*d*(c + d*x)*sin(a + b*x)^3)/(9*b^2)]
    @test_int [sin(a + b*x)^3*(c + d*x)^1, x, 3, -((2*(c + d*x)*cos(a + b*x))/(3*b)) + (2*d*sin(a + b*x))/(3*b^2) - ((c + d*x)*cos(a + b*x)*sin(a + b*x)^2)/(3*b) + (d*sin(a + b*x)^3)/(9*b^2)]
    @test_int [sin(a + b*x)^3/(c + d*x)^1, x, 8, -((CosIntegral((3*b*c)/d + 3*b*x)*sin(3*a - (3*b*c)/d))/(4*d)) + (3*CosIntegral((b*c)/d + b*x)*sin(a - (b*c)/d))/(4*d) + (3*cos(a - (b*c)/d)*SinIntegral((b*c)/d + b*x))/(4*d) - (cos(3*a - (3*b*c)/d)*SinIntegral((3*b*c)/d + 3*b*x))/(4*d)]
    @test_int [sin(a + b*x)^3/(c + d*x)^2, x, 8, (3*b*cos(a - (b*c)/d)*CosIntegral((b*c)/d + b*x))/(4*d^2) - (3*b*cos(3*a - (3*b*c)/d)*CosIntegral((3*b*c)/d + 3*b*x))/(4*d^2) - sin(a + b*x)^3/(d*(c + d*x)) - (3*b*sin(a - (b*c)/d)*SinIntegral((b*c)/d + b*x))/(4*d^2) + (3*b*sin(3*a - (3*b*c)/d)*SinIntegral((3*b*c)/d + 3*b*x))/(4*d^2)]
    @test_int [sin(a + b*x)^3/(c + d*x)^3, x, 12, (9*b^2*CosIntegral((3*b*c)/d + 3*b*x)*sin(3*a - (3*b*c)/d))/(8*d^3) - (3*b^2*CosIntegral((b*c)/d + b*x)*sin(a - (b*c)/d))/(8*d^3) - (3*b*cos(a + b*x)*sin(a + b*x)^2)/(2*d^2*(c + d*x)) - sin(a + b*x)^3/(2*d*(c + d*x)^2) - (3*b^2*cos(a - (b*c)/d)*SinIntegral((b*c)/d + b*x))/(8*d^3) + (9*b^2*cos(3*a - (3*b*c)/d)*SinIntegral((3*b*c)/d + 3*b*x))/(8*d^3)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [csc(a + b*x)*(c + d*x)^3, x, 9, -((2*(c + d*x)^3*atanh(ℯ^(im*(a + b*x))))/b) + (3*im*d*(c + d*x)^2*PolyLog(2, -ℯ^(im*(a + b*x))))/b^2 - (3*im*d*(c + d*x)^2*PolyLog(2, ℯ^(im*(a + b*x))))/b^2 - (6*d^2*(c + d*x)*PolyLog(3, -ℯ^(im*(a + b*x))))/b^3 + (6*d^2*(c + d*x)*PolyLog(3, ℯ^(im*(a + b*x))))/b^3 - (6*im*d^3*PolyLog(4, -ℯ^(im*(a + b*x))))/b^4 + (6*im*d^3*PolyLog(4, ℯ^(im*(a + b*x))))/b^4]
    @test_int [csc(a + b*x)*(c + d*x)^2, x, 7, -((2*(c + d*x)^2*atanh(ℯ^(im*(a + b*x))))/b) + (2*im*d*(c + d*x)*PolyLog(2, -ℯ^(im*(a + b*x))))/b^2 - (2*im*d*(c + d*x)*PolyLog(2, ℯ^(im*(a + b*x))))/b^2 - (2*d^2*PolyLog(3, -ℯ^(im*(a + b*x))))/b^3 + (2*d^2*PolyLog(3, ℯ^(im*(a + b*x))))/b^3]
    @test_int [csc(a + b*x)*(c + d*x)^1, x, 5, -((2*(c + d*x)*atanh(ℯ^(im*(a + b*x))))/b) + (im*d*PolyLog(2, -ℯ^(im*(a + b*x))))/b^2 - (im*d*PolyLog(2, ℯ^(im*(a + b*x))))/b^2]
    @test_int [csc(a + b*x)/(c + d*x)^1, x, 0, Unintegrable(csc(a + b*x)/(c + d*x), x)]
    @test_int [csc(a + b*x)/(c + d*x)^2, x, 0, Unintegrable(csc(a + b*x)/(c + d*x)^2, x)]


    @test_int [csc(a + b*x)^2*(c + d*x)^3, x, 6, -((im*(c + d*x)^3)/b) - ((c + d*x)^3*cot(a + b*x))/b + (3*d*(c + d*x)^2*log(1 - ℯ^(2*im*(a + b*x))))/b^2 - (3*im*d^2*(c + d*x)*PolyLog(2, ℯ^(2*im*(a + b*x))))/b^3 + (3*d^3*PolyLog(3, ℯ^(2*im*(a + b*x))))/(2*b^4)]
    @test_int [csc(a + b*x)^2*(c + d*x)^2, x, 5, -((im*(c + d*x)^2)/b) - ((c + d*x)^2*cot(a + b*x))/b + (2*d*(c + d*x)*log(1 - ℯ^(2*im*(a + b*x))))/b^2 - (im*d^2*PolyLog(2, ℯ^(2*im*(a + b*x))))/b^3]
    @test_int [csc(a + b*x)^2*(c + d*x)^1, x, 2, -(((c + d*x)*cot(a + b*x))/b) + (d*log(sin(a + b*x)))/b^2]
    @test_int [csc(a + b*x)^2/(c + d*x)^1, x, 0, Unintegrable(csc(a + b*x)^2/(c + d*x), x)]
    @test_int [csc(a + b*x)^2/(c + d*x)^2, x, 0, Unintegrable(csc(a + b*x)^2/(c + d*x)^2, x)]


    @test_int [csc(a + b*x)^3*(c + d*x)^3, x, 15, -((6*d^2*(c + d*x)*atanh(ℯ^(im*(a + b*x))))/b^3) - ((c + d*x)^3*atanh(ℯ^(im*(a + b*x))))/b - (3*d*(c + d*x)^2*csc(a + b*x))/(2*b^2) - ((c + d*x)^3*cot(a + b*x)*csc(a + b*x))/(2*b) + (3*im*d^3*PolyLog(2, -ℯ^(im*(a + b*x))))/b^4 + (3*im*d*(c + d*x)^2*PolyLog(2, -ℯ^(im*(a + b*x))))/(2*b^2) - (3*im*d^3*PolyLog(2, ℯ^(im*(a + b*x))))/b^4 - (3*im*d*(c + d*x)^2*PolyLog(2, ℯ^(im*(a + b*x))))/(2*b^2) - (3*d^2*(c + d*x)*PolyLog(3, -ℯ^(im*(a + b*x))))/b^3 + (3*d^2*(c + d*x)*PolyLog(3, ℯ^(im*(a + b*x))))/b^3 - (3*im*d^3*PolyLog(4, -ℯ^(im*(a + b*x))))/b^4 + (3*im*d^3*PolyLog(4, ℯ^(im*(a + b*x))))/b^4]
    @test_int [csc(a + b*x)^3*(c + d*x)^2, x, 9, -(((c + d*x)^2*atanh(ℯ^(im*(a + b*x))))/b) - (d^2*atanh(cos(a + b*x)))/b^3 - (d*(c + d*x)*csc(a + b*x))/b^2 - ((c + d*x)^2*cot(a + b*x)*csc(a + b*x))/(2*b) + (im*d*(c + d*x)*PolyLog(2, -ℯ^(im*(a + b*x))))/b^2 - (im*d*(c + d*x)*PolyLog(2, ℯ^(im*(a + b*x))))/b^2 - (d^2*PolyLog(3, -ℯ^(im*(a + b*x))))/b^3 + (d^2*PolyLog(3, ℯ^(im*(a + b*x))))/b^3]
    @test_int [csc(a + b*x)^3*(c + d*x)^1, x, 6, -(((c + d*x)*atanh(ℯ^(im*(a + b*x))))/b) - (d*csc(a + b*x))/(2*b^2) - ((c + d*x)*cot(a + b*x)*csc(a + b*x))/(2*b) + (im*d*PolyLog(2, -ℯ^(im*(a + b*x))))/(2*b^2) - (im*d*PolyLog(2, ℯ^(im*(a + b*x))))/(2*b^2)]
    @test_int [csc(a + b*x)^3/(c + d*x)^1, x, 0, Unintegrable(csc(a + b*x)^3/(c + d*x), x)]
    @test_int [csc(a + b*x)^3/(c + d*x)^2, x, 0, Unintegrable(csc(a + b*x)^3/(c + d*x)^2, x)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^(m/2)*sin(e+f*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sin(a + b*x)*(c + d*x)^(5/2), x, 8, (15*d^2*sqrt(c + d*x)*cos(a + b*x))/(4*b^3) - ((c + d*x)^(5/2)*cos(a + b*x))/b - (15*d^(5/2)*sqrt(pi/2)*cos(a - (b*c)/d)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/(4*b^(7/2)) + (15*d^(5/2)*sqrt(pi/2)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/(4*b^(7/2)) + (5*d*(c + d*x)^(3/2)*sin(a + b*x))/(2*b^2)]
    @test_int [sin(a + b*x)*(c + d*x)^(3/2), x, 7, -(((c + d*x)^(3/2)*cos(a + b*x))/b) - (3*d^(3/2)*sqrt(pi/2)*cos(a - (b*c)/d)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/(2*b^(5/2)) - (3*d^(3/2)*sqrt(pi/2)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/(2*b^(5/2)) + (3*d*sqrt(c + d*x)*sin(a + b*x))/(2*b^2)]
    @test_int [sin(a + b*x)*(c + d*x)^(1/2), x, 6, -((sqrt(c + d*x)*cos(a + b*x))/b) + (sqrt(d)*sqrt(pi/2)*cos(a - (b*c)/d)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/b^(3/2) - (sqrt(d)*sqrt(pi/2)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/b^(3/2)]
    @test_int [sin(a + b*x)/(c + d*x)^(1/2), x, 5, (sqrt(2*pi)*cos(a - (b*c)/d)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/(sqrt(b)*sqrt(d)) + (sqrt(2*pi)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/(sqrt(b)*sqrt(d))]
    @test_int [sin(a + b*x)/(c + d*x)^(3/2), x, 6, (2*sqrt(b)*sqrt(2*pi)*cos(a - (b*c)/d)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/d^(3/2) - (2*sqrt(b)*sqrt(2*pi)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/d^(3/2) - (2*sin(a + b*x))/(d*sqrt(c + d*x))]
    @test_int [sin(a + b*x)/(c + d*x)^(5/2), x, 7, -((4*b*cos(a + b*x))/(3*d^2*sqrt(c + d*x))) - (4*b^(3/2)*sqrt(2*pi)*cos(a - (b*c)/d)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/(3*d^(5/2)) - (4*b^(3/2)*sqrt(2*pi)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/(3*d^(5/2)) - (2*sin(a + b*x))/(3*d*(c + d*x)^(3/2))]
    @test_int [sin(a + b*x)/(c + d*x)^(7/2), x, 8, -((4*b*cos(a + b*x))/(15*d^2*(c + d*x)^(3/2))) - (8*b^(5/2)*sqrt(2*pi)*cos(a - (b*c)/d)*FresnelC((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d)))/(15*d^(7/2)) + (8*b^(5/2)*sqrt(2*pi)*FresnelS((sqrt(b)*sqrt(2/pi)*sqrt(c + d*x))/sqrt(d))*sin(a - (b*c)/d))/(15*d^(7/2)) - (2*sin(a + b*x))/(5*d*(c + d*x)^(5/2)) + (8*b^2*sin(a + b*x))/(15*d^3*sqrt(c + d*x))]


    @test_int [sin(a + b*x)^2*(c + d*x)^(5/2), x, 10, -((5*d*(c + d*x)^(3/2))/(16*b^2)) + (c + d*x)^(7/2)/(7*d) - (15*d^(5/2)*sqrt(pi)*cos(2*a - (2*b*c)/d)*FresnelS((2*sqrt(b)*sqrt(c + d*x))/(sqrt(d)*sqrt(pi))))/(128*b^(7/2)) - (15*d^(5/2)*sqrt(pi)*FresnelC((2*sqrt(b)*sqrt(c + d*x))/(sqrt(d)*sqrt(pi)))*sin(2*a - (2*b*c)/d))/(128*b^(7/2)) - ((c + d*x)^(5/2)*cos(a + b*x)*sin(a + b*x))/(2*b) + (5*d*(c + d*x)^(3/2)*sin(a + b*x)^2)/(8*b^2) + (15*d^2*sqrt(c + d*x)*sin(2*a + 2*b*x))/(64*b^3)]
    @test_int [sin(a + b*x)^2*(c + d*x)^(3/2), x, 9, -((3*d*sqrt(c + d*x))/(16*b^2)) + (c + d*x)^(5/2)/(5*d) + (3*d^(3/2)*sqrt(pi)*cos(2*a - (2*b*c)/d)*FresnelC((2*sqrt(b)*sqrt(c + d*x))/(sqrt(d)*sqrt(pi))))/(32*b^(5/2)) - (3*d^(3/2)*sqrt(pi)*FresnelS((2*sqrt(b)*sqrt(c + d*x))/(sqrt(d)*sqrt(pi)))*sin(2*a - (2*b*c)/d))/(32*b^(5/2)) - ((c + d*x)^(3/2)*cos(a + b*x)*sin(a + b*x))/(2*b) + (3*d*sqrt(c + d*x)*sin(a + b*x)^2)/(8*b^2)]
